import{_ as o,c as l,a1 as t,o as n}from"./chunks/framework.DRENrv6Y.js";const d=JSON.parse('{"title":"in.clusion","description":"","frontmatter":{"title":"in.clusion","customTag":"blog>线下活动","editLink":true,"date":"2023.9.9"},"headers":[],"relativePath":"blog/in-clusion.md","filePath":"blog/in-clusion.md","lastUpdated":1729998335000}'),s={name:"blog/in-clusion.md"};function e(r,i,a,p,c,u){return n(),l("div",null,i[0]||(i[0]=[t('<h1 id="in-clusion-外滩大会" tabindex="-1">in.clusion 外滩大会 <a class="header-anchor" href="#in-clusion-外滩大会" aria-label="Permalink to &quot;in.clusion 外滩大会&quot;">​</a></h1><div class="tip custom-block"><p class="custom-block-title">TIP</p><ul><li><p><strong>Tags</strong>: 创业思考, 线下活动</p></li><li><p><strong>Date</strong>: September 9, 2023</p></li><li><p><strong>HightLight</strong>:</p><ul><li><a href="https://www.notion.so/in-clusion-96d2a23a087845ef804c81f74410e50f?pvs=21" target="_blank" rel="noreferrer">https://www.notion.so/in-clusion-96d2a23a087845ef804c81f74410e50f?pvs=21</a></li><li><a href="https://www.notion.so/in-clusion-96d2a23a087845ef804c81f74410e50f?pvs=21" target="_blank" rel="noreferrer">https://www.notion.so/in-clusion-96d2a23a087845ef804c81f74410e50f?pvs=21</a> :::</li></ul></li></ul><p>周末去了趟外滩大会。</p><p>也记录自己的输入和输出吧。</p><p>首先先说一下活动的体感。</p><p>整体体感：总体活动没有达到自己理想中的预期，但还是有信息输入，总体还算不错。</p><ol><li>蚂蚁/阿里还是开源了不少的产品/工具。今天看到的有 Web IDE 工具，oceanBase 数据库， TuGraph 等产品。</li><li>生活中金融场景其实还是挺多的，涵盖个人理财，日常消费。</li><li>针对 AIGC 生成的内容，提供检测真实性、敏感性的工具。</li><li>艺术品 * 数字化，也是有一些场景的。</li><li>在国内，区块链更多做溯源和追踪的场景，而相对来说 Web 3 的场景在国内展示还不是很好成立吧。</li></ol><p>也记录一下自己的输出吧。</p><ol><li><strong>上海的多元化</strong>：上海真是个神奇的地方，外滩大会有各种年龄段的人群来到这一边。</li><li><strong>接触了解金融</strong>：个人而言，今天金融对于我来说，还是一个比较陌生的名词，可能是从小的环境并没有给一些投资、理财上的输入。但并不代表我们不能接触。</li><li>**接触其他技术&amp;领域：**对于数据库、硬件、算法等知识，目前自己感到了陌生，好像我自己把自己置于了一个前端的角色，其他东西自己也没咋看。其他领域也一样，消费品、金融、工业等，自己也不是很了解。但如果你要做一名独立开发者，<strong>请你保持一个终身学习的理念</strong>。</li><li>**数字 * 艺术品：**理性和感性的结合。</li><li><strong>Web 3</strong>： 可以稍微了解，但在国内暂时不要碰。</li><li>以后要让公司能在活动的最中心。</li><li><strong>Sale your or your product</strong>: 今天在具体的摊位问了下对应的工作人员由关于产品的事情，感觉有些工作人员可能都没能很好理解自己的产品。<strong>但当你真正销售一个产品时，你一定要了解它</strong>。</li></ol></div>',2)]))}const f=o(s,[["render",e]]);export{d as __pageData,f as default};
